import LandingPage from './Container/LandingPage';

function App() {
  return (
    <div>
    <BrowserRouter>
      {/* <NavBar/> */}

      <Routes>
        <Route path="/" element={<LandingPage />} />
      </Routes>
      </BrowserRouter>
    </div>
  );

}

export default App;
